import styles from './Navbar.module.scss';

const Nav = () => {
  return (
    <div>
      <ul className={styles.nav}>
        <li>
          <a href="default.asp">Home</a>
        </li>
        <li>
          <a href="news.asp">News</a>
        </li>
        <li>
          <a href="contact.asp">Contact</a>
        </li>
        <li>
          <a href="about.asp">About</a>
        </li>
      </ul>
    </div>
  );
};

export default Nav;
